import React, { useEffect, useState } from "react";
import axios from "axios";

function introduccion() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:3002/")
      .then((res) => {
        setData(res.data.contact);
      })
      .catch((error) => console.log(error));
  }, []);

  return (
    <div className="container">
    
    {data.map((contact, index) => (
          <div className="row seccion" key={index}>
          <div className="container-skills">
            <div className="col-lg-8 col-md-6 col-sm-12">
              <div className="contenido">
                <h1>Hi, I am {contact.name}</h1>
                <h4>and I am a software developer</h4>
                <p>{contact.description}</p>
              </div>
            </div>
            <div className="col-lg-4 col-md-6 col-sm-12 profile-container">
              <img src="images/perfil.png" width="50%" className="profile"/>
            </div>
          </div>
          </div>
        ))}
    
        
      
    </div>
  );
}
export default introduccion;
